script: |
  super -f tsv -I q639.sql | sort > q639.out

vector: true

inputs:
  - name: q639.sql
    data: |
      SELECT DISTINCT + col2 + cor0.col0 / col0 + col2 AS col1 FROM tab1 AS cor0 WHERE NOT NULL NOT BETWEEN NULL AND col2 + cor0.col0 OR NULL NOT BETWEEN ( - col0 ) AND NULL;
  - name: tab1

outputs:
  - name: q639.out
    data: |
